import { registerIcon } from "@ui5/webcomponents-base/dist/SVGIconRegistry.js";

const name = "vertical-bar-chart";
const pathData = "M232 416q-8 0-8-8V168q0-8 8-8h48q8 0 8 8v240q0 8-8 8h-48zm-128 0q-8 0-8-8V232q0-8 8-8h48q8 0 8 8v176q0 8-8 8h-48zm256 0q-8 0-8-8V40q0-8 8-8h48q8 0 8 8v368q0 8-8 8h-48zM32 448h448v32H32v-32z";

registerIcon(name, { pathData });

export default { pathData };
